import { Route, Routes } from "react-router-dom";
import React from "react";

function Router() {
  return (
    <>
        <Router>
            <Route exact path="/" component={Home} />
            <Route path="/about" component={About} />
            <Route component={NotFound} />
        </Router>
    </>
  );
}

export default Router;
